    const[link] = useState(props.sublink)

    const handleLink = (link) => {
        navigate(link)
        navigate(0)
    }

    return(
        <div className="settingssubnav-container">
            <Link className={link === "subscription" ? "active" : ""} to={'/dashboard/affiliate/settings/subscription'}>Subscription</Link>
            <Link className={link === "test" ? "active" : ""} to={'/dashboard/affiliate/settings/test'}>Test</Link>
        </div>
    )
}

